const UmlItem = (props) => {
    return (
      <li>
        
          <div >
            olduml  :{props.olduml}
          </div>
          <div >
            newuml  :{props.newuml}
            </div>
            <div>
            button onClick={() => this.props.deleteTodo(this.props.id)} Delete
            </div>
            
       
      </li>
    );
  };
  export default UmlItem;
